		// ÂàÜËØç
		final List<Term> segment = NotionalTokenizer.segment(inputStr);
		final Set<String> words = CollectionUtil.toSet(segment, term -> TrendApi.formatWord(term.word));
		log.info("ÂàÜËØçÁªìÊûúÔºö{}", StringUtil.joins(words, " | "));

