	@Test
	public void testAddField() throws Exception {
		ElasticsearchClient client = esEngineClient.client;
		final String indexName = ESIndex.KEYWORDS_ACCURATE_INDEX.name().toLowerCase();
		final String fieldName = "providerType";
		// Step 1: Ëé∑ÂèñÁ¥¢ÂºïÊò†Â∞ÑÂÖ≥Á≥ª
		final TypeMapping typeMapping = client.indices()
				.getMapping(GetMappingRequest.of(r -> r.index(indexName)))
				.get(indexName).mappings();
		final Map<String, Property> properties = typeMapping.properties();

		if (!properties.containsKey(fieldName)) {
			// Step 2: Ê∑ªÂä†Â≠óÊÆµ
			client.indices().putMapping(PutMappingRequest.of(req -> req
					.index(indexName)
					.properties(fieldName, Property.of(p -> p.integer(i -> i))) // TODO ËÆæÁΩÆ‰∏∫integerÁ±ªÂûãÔºÅ
			));

			System.out.println("‚úÖ Ê∑ªÂä†Â≠óÊÆµÊàêÂäüÔºö" + fieldName);
		} else {
			System.out.println("‚ÑπÔ∏è Â≠óÊÆµÂ∑≤Â≠òÂú®Ôºö" + fieldName);
		}

		// Step 3: Êõ¥Êñ∞Áé∞ÊúâÊñáÊ°£ÈªòËÆ§ÂÄº
		final UpdateByQueryResponse response = client.updateByQuery(UpdateByQueryRequest.of(req -> req
				.index(indexName)
				.script(s -> s
						// ÈÄöËøáËÑöÊú¨ËÆæÁΩÆÈªòËÆ§ÂÄº
						.source(builder -> builder.scriptString(
								// TODO Ë∞ÉÊï¥ÈªòËÆ§ÂÄº
								"if (ctx._source." + fieldName + " == null) { ctx._source." + fieldName + " = 0; }"
						))
						.lang("painless")
				)
				.query(q -> q
						.bool(b -> b
								.mustNot(mn -> mn
										.exists(e -> e.field(fieldName))
								)
						)
				)
		));
		System.out.println("üîÅ Êõ¥Êñ∞ÊñáÊ°£Êï∞ÊçÆ: " + response.updated());
	}

